function findHexStrings(longString) {
  const hexStrings = [];
  let start = 0;

  while (start < longString.length) {
    if (longString.slice(start, start + 2) === "0x") {
      // Check if the substring length is within the range
      let end = start + 2;
      while (end < longString.length && longString[end].match(/^\w+$/)) {
        end++;
      }
      if (end - start >= 35 && end - start <= 45) {
        hexStrings.push(longString.slice(start, end));
      }
    }
    start++;
  }
  return hexStrings;
}

